DROP TABLE IF EXISTS `product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product` (
  `product_id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(45) DEFAULT NULL,
  `description` varchar(45) DEFAULT NULL,
  `category_id` int unsigned DEFAULT NULL,
  `color` varchar(45) DEFAULT NULL,
  `materials` varchar(45) DEFAULT NULL,
  `initial_price` int unsigned DEFAULT NULL,
  `current_price` int unsigned DEFAULT NULL,
  `release_date` date DEFAULT NULL,
  `state_of_shown_info` enum('HIDE_ALL','INFO_ONLY','ALL_VISIBLE') DEFAULT 'HIDE_ALL',
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `product_id_UNIQUE` (`product_id`),
  KEY `category_id_idx` (`category_id`),
  CONSTRAINT `category_id_from_product` FOREIGN KEY (`category_id`) REFERENCES `category` (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1026 DEFAULT CHARSET=utf8mb3;
